import{ab as t,H as n,I as i,G as e,V as a,O as s,ac as c,Y as o}from"./framework-c2f60e5e.js";const d={},h=c('<h1 id="一些re知识" tabindex="-1"><a class="header-anchor" href="#一些re知识" aria-hidden="true">#</a> 一些Re知识</h1><h2 id="c32asm" tabindex="-1"><a class="header-anchor" href="#c32asm" aria-hidden="true">#</a> C32Asm</h2><p>一款非常不错的国产静态反编译工具，C32Asm现具有如下功能：快速静态反编译PE格式文件(Exe、Dll等)，提供Hex文件编辑功能，功能强大，提供内存Dump、内存编辑、PE文件Dump、PE内存ImageSize修正等多种实用功能。</p><p>通常主要讲C32Asm当做16进制编辑器来使用，因为成熟的静态反编译工具如IDA等已经非常强大了，本实验中也只使用C32Asm的十六进制编辑器功能。C32Asm可以十分方便的进行十六进制编辑操作，同时支持对指定的数据块进行各种运算操作，包括异或运算等。</p><h2 id="二维码" tabindex="-1"><a class="header-anchor" href="#二维码" aria-hidden="true">#</a> 二维码</h2>',5),l={href:"http://cli.im/%E7%AD%89%E3%80%82",target:"_blank",rel:"noopener noreferrer"},_=e("h2",{id:"exif信息",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#exif信息","aria-hidden":"true"},"#"),a(" Exif信息")],-1),f=e("p",null,"Exif是一种图象文件格式，它的数据存储与JPEG格式是完全相同的。实际上Exif格式就是在JPEG格式头部插入了数码照片的信息，包括拍摄时的光圈、快门、白平衡、ISO、焦距、日期时间等各种和拍摄条件以及相机品牌、型号、色彩编码、拍摄时录制的声音以及全球定位系统（GPS）、缩略图等。简单地说，Exif=JPEG+拍摄参数。因此，你可以利用任何可以查看JPEG文件的看图软件浏览Exif格式的照片，但并不是所有的图形程序都能处理Exif信息。",-1);function m(x,E){const r=o("ExternalLinkIcon");return n(),i("div",null,[h,e("p",null,[a("二维码（Quick Response Code），又称二维条码。它是用特定的几何图形按一定规律在平面（二维方向）上分布的黑白相间的图形，是所有信息数据的一把钥匙。在现代商业活动中，二维码的应用十分广泛，如：产品防伪/溯源、广告推送、网站链接、数据下载、商品交易、定位/导航、电子商务应用、车辆管理、信息传递等。如今的二维码应用十分的广泛，许多手机APP都可以进行二维码信息的识别以及二维码图片生成等，互联网上也有许多支持二维码生成以及二维码信息提取的网站，如"),e("a",l,[a("http://cli.im/等。"),s(r)])]),_,f])}const u=t(d,[["render",m],["__file","一些Re知识.html.vue"]]);export{u as default};
